import './cardContainer.css';

const CardContainer = (props) => {
    return (
        <div className="px-48 py-30 border-5 border-black">
            <div className="absolute flex h-full w-full z-10 ">

                    {
                        props.cards.map( (element, index) => {
                            return index < 4 ? element : null;
                        })
                    }

            </div>

            <div className="absolute flex h-full w-full z-0">

                    {
                        props.cards.map( (element, index) => {
                            return index > 3 ? element : null;
                        })
                    }

            </div>
            {/* {
                props.cards.map( (element) => {
                    return element
                })
            } */}
        </div>

    )
}

